import { createPost } from '../api';

const CreatePost = ({ token }) => {
    const newPost = {
        title: 'Steph post',
        description: "Steph test",
        price: '$$$',
        location: 'My house',
        willDeliver: true
    }

    async function addPost() {
        const result = await createPost(token, newPost)
    }

    return (
        <button onClick={() => addPost()}>Creat New Post</button>
    )
}

export default CreatePost;
